import logo from './quotation.svg';
import './App.css';
import React from 'react'
import { Redirect } from 'react-router-dom'

function App() {


  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Welcome to QuoteBank!
        </p>
        <div>
        <button>Enter</button>
       </div>
      </header>
    </div>
  );
}

export default App;
